import { handleClick, NextCard } from './NextCard';
//import CardItem from './CardItem';

function Home() {
  return (
    <>
      <div className='container'>
        <h1>Sorry!</h1>
        <NextCard />
        <button onClick={handleClick} className='button'>Next Card</button>
      </div>
    </>
  );
}

export default Home;
